import styled from "styled-components";

const PageTitle = styled.div`
  width: 100%;
  padding: 50px 100px;
`;
const FormWrap = styled.div`
  width: 100%;
  padding: 50px 100px;

  div .title {
  }

  .content label {
    display: block;
  }
  input {
    width: 70%;
  }
  textarea {
    height: 200px;
    width: 70%;
    padding: 10px;
    border-radius: 5px;
    font-size: 16px;
    resize: none;
  }
`;

const WritingPage = () => {
  return (
    <>
      <PageTitle>커뮤니티 › 게시글 작성</PageTitle>
      <FormWrap>
        <form>
          <div className="title">
            <label>제목</label>
            <input type="text" />
          </div>
          <div className="content">
            <label>게시글 내용</label>
            <textarea></textarea>
          </div>
          <input type="submit" value="작성 완료" />
        </form>
      </FormWrap>
    </>
  );
};

export default WritingPage;
